    false,nt"url": null,nt"notes": "The RGB/CIR ONE-foot orthophotos to be
    mapped consists of 4,033 cells (approximately 3,617 square miles) flown with a Z/I
    Intergraph DMC airborne digital sensor under SWFWMD contract entitled "FY2011 Digital
    orthophoto (B089) - 2011" and Purchase Order 11POSOW0137. The flight season was
    from December 1, 20010 through March 15, 2011. The flight dates are as follows:
    December 09, 2010; January 7, 2011; January 9, 2011; January 12, 2011; January 13,
    2011; January 15, 2011; and January 23, 2011. All images were collected between
    10:00 AM to 2:30 PM to minimize shadows. All images were obtained under cloud free
    conditions. Please see the survey report for the accuracy report.",nt"owner_org":
